export default function todoToEditReducer(state = '', action) {

    switch (action.type) {
        case "EDIT_TODO":
          todoToEdit = {
            title: action.todoToEdit.title,
            content: action.todoToEdit.content
          }
            return action.todoToEdit
      default:
        return state
      }
  }
